import './App.css';
import { BrowserRouter as Router ,Routes, Route} from 'react-router-dom'
import Main_area from './components/main_area.jsx';
import Login from './components/Login.js'

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<Login/>}/>
      </Routes>
    </Router>
    // <div className="App">
    //   <Main_area />
    // </div>
  );
}

export default App;
